window.bookSummaryJSON = "<p><i>Guardians of the Phoenix </i>includes audiobooks one through five of the best-selling Guardians of the Fae Realms fantasy romance series in one volume: <i>Rise of the Phoenix, Wolf's Soul, Bear's Strength, Hawk's Heart, and Jaguar's Passion.</i></p> <p>Monsters, magic, and mates I never knew existed.</p> <p>My beater of a car versus a power pole isn't the end I expect—it's the beginning of... gawd, where do I begin?</p> <p>Four wildly sexy males. Powers I don't understand. And the eyes of the fae world on me as the person to unite the severed realms.</p> <p>No pressure.</p> <p>Kotah, Brant, Jaxx, and Hawk grew up hearing the legends of how one day, the phoenix would rise and unite the realms. They never thought it would happen, and they certainly never thought the fae universe would choose each of them to be her fated mates.</p> <p>But when Calli wakes from a fatal car crash, reborn into an enchanted world she neither understands, nor is prepared for, those four wildling shifters are her only chance at survival. As evil forces close in and situations become heated, Calli finds she needs her Guardians almost as much as they need her.</p> <p><i>*The Guardians of the Phoenix is </i>a complete five audiobook steamy paranormal romance series where the heroine doesn't have to choose. Expect intense situations, rollicking action, ongoing storylines, and shifter lovers who find what they need from not only their queen, but each other as well.*</p>"; 
